int majorityElement(vector<int>& nums)
{
    int output = nums[0];
    int count = 1;
    for(int n : nums) {
        if(n == output)
            count++;
        else
            count--;

        if(count == 0) {
            output = n;
            count = 1;
        }
    }
    return output;
}

